import React from "react";
import { useState } from "react";
import carNames from "./cars";

function App() {

    const [car, setCar] = useState(carNames);
    function clickHandle(e){
        const newCarArray = car.filter(item=>item.id!=2);
        setCar(newCarArray);
        console.log(e);
    }
    return <div>
        {car.map(item=>{
            return <h1 key={item.id}>{item.note}</h1>
        })}
        <button onClick={clickHandle(e)}>Button</button>
    </div>;
}


export default App;
